import {Card, CardHeader, Container,Grid, CardContent, Box, Typography} from '@mui/material';
// so evertime I use the Container or Card component I get an error: Uncaught Error: Invalid hook call.
// OK so I was importing from "@mui/core" instead of "@mui/material"
function Services(){
    return(
        <Container>
            <Grid container spacing={5}
            justifyContent="center"
            alignItems="center">
                <Grid item> 
                    <Card>
                        <CardHeader
                            title={'Basic'}
                        />
                        <CardContent>
                            <Box>
                                <Typography>
                                    Content stuff 1
                                </Typography>
                            </Box>
                        </CardContent>

                    </Card>
                </Grid>
                <Grid item>
                    <Card>
                        <CardHeader
                            title={'Pro'}
                            sx={{
                                backgroundColor: '#ADD8E6'
                            }}

                        />
                        <CardContent>
                            <Box>
                                <Typography>
                                    Content Stuff2
                                </Typography>
                            </Box>
                        </CardContent>
                    </Card>
                </Grid>

            </Grid>
        </Container>


    )
}
export default Services;
